import React from 'react';
import { Card, Avatar, CardHeader } from '@material-ui/core';
import EmojiEventsIcon from "@material-ui/icons/EmojiEvents";

export const CustomerCard = (props) => {
    return(
        <Card>
        <CardHeader
            avatar = {
                <Avatar>
                    <EmojiEventsIcon />
                </Avatar>
            }
        />
    </Card>
    )
}
